import React from "react";
import "../styles/About.css";

function About() {
  return (
    <div className="prompt">
      <p className="aboutMe">
        I am Olawale Peter, an intermediate front-end developer with 3 years of
        experience in developing user-friendly websites and web applications.
        Proficient in Java script, HTML, CSS and React. Familiar with Photoshop,
        Figma, Adobe Xd and other design tools. strong ability to create
        responsive and visuallyappealing designs with provem ability to work
        effectively in a team enviroment and deliver projects on time and within
        budget. Strong attention to detail and a passion for staying current
        with the latest technology and industry trends'
      </p>
    </div>
  );
}

export default About;
